data.value:
// Various states of the state machine
`define initialize 3'b001
`define fetch_instruction 3'b010
`define executesinglebyteinstruction 3'b011
`define fetchOpcode 3'b100
`define executefullinstruction 3'b101

`define clearAccumulator 3'b001
`define complementaccumulator 3'b010
`define halt 3'b000

`define branch 3'b110
`define sta    3'b101
`define lda    3'b000
`define ann    3'b001
`define add    3'b010
`define sbb    3'b011

module custom_central_processing_unit_AD(clk, reset, read_mem, write_mem, databus, addressbus, haltsignal, ready, grantbusaccess);

output read_mem, write_mem,haltsignal;
input clk,reset,ready,grantbusaccess;
inout[7:0]databus;
output [11:0]addressbus;

reg [11:0]addressbus;
reg [7:0] databusoutput;
assign databus = databusoutput;

reg read_mem, write_mem,haltsignal;


// custom registers internal to the CPU block

reg[3:0] state_machine_present_state, state_machine_next_state;
reg[7:0] accummulator, acc_next_state, instr_register, ir_next_state;
reg[3:0] statusregister, sr_next_state;
reg[11:0] programcounter, pc_next_state;
reg[11:0] memoryaddressreg, mar_next_state;
reg[9:0] tempResultRegister;

initial begin
state_machine_present_state <= `initialize;
state_machine_next_state <= `initialize;
end // end of initial block

always @(negedge clk) begin 
 if(reset) begin
  state_machine_present_state <=`initialize;
  accummulator <= 8'b00000000;
  instr_register <= 8'b00000000;
  programcounter <= 12'b000000000000;
  memoryaddressreg <= 12'b000000000000;
  statusregister <= 4'b0000;
end     // reset if 
else begin   // at the negative edge of clock the next state values of all the internal registers are updated
accummulator<=acc_next_state;                 
instr_register<=ir_next_state;
statusregister<=sr_next_state;
programcounter<=pc_next_state;
memoryaddressreg<=mar_next_state;
state_machine_present_state<=state_machine_next_state;  // every clock cycle
end

end // end always block always @(negedge clk)



always @(state_machine_present_state or reset or ready or grantbusaccess or databus or accummulator or instr_register or statusregister or programcounter or memoryaddressreg)
begin 
read_mem<=1'b0;   // read memory signal is 0
write_mem<=1'b0;  // write memory signal is 0
haltsignal<=1'b0; // halt condition is reset
databusoutput <=8'bzzzzzzzz;
addressbus <=  12'bzzzzzzzzzzzz;
tempResultRegister =10'b0000000000;
// next state register are hold registers, initialize these registers to current values
acc_next_state <= accummulator;
ir_next_state <= instr_register;
sr_next_state <= statusregister;
pc_next_state <= programcounter;
mar_next_state <= memoryaddressreg;

case (state_machine_present_state)

`initialize: begin
  if(reset) begin
  programcounter<=0;
  state_machine_next_state<=`initialize;
  end
  else begin
  state_machine_next_state <=`fetch_instruction;
  mar_next_state <= programcounter;   // memoryaddressreg will contain pc value in the next state
  end
end

`fetch_instruction: begin  // databus value goes to the IR register
	read_mem<=1'b1;

if(grantbusaccess) begin
addressbus<=memoryaddressreg;  // write to the output address bus, fetch for address programcounter
 if(ready) begin
	ir_next_state <= databus;
	pc_next_state<=programcounter+1;
	state_machine_next_state<=`executesinglebyteinstruction;
	end
  else // wait for ready signal
	state_machine_next_state<=`fetch_instruction;
end
   else  // wait for the grant signal
	state_machine_next_state<=`fetch_instruction;

end

`executesinglebyteinstruction : begin
  mar_next_state <= programcounter;   // memoryaddressreg will contain pc value in the next state
  if(instr_register[7:5] != 3'b111)   
      state_machine_next_state<=`fetchOpcode;    // this is a branch instruction
  else begin                                      // single byte instruction 3'b111
   case (instr_register[2:0])
    `clearAccumulator: acc_next_state<=0;
    `complementaccumulator: begin
     acc_next_state<= ~accummulator;
     sr_next_state[0]<=accummulator[7];
     sr_next_state[1]<=~|( ~accummulator );
     end
    `halt: haltsignal<=1'b1;
     endcase  // endcase
state_machine_next_state <= `fetch_instruction;
 end  //else begin
end // singlebyteinstruction


`fetchOpcode : begin
read_mem <=1'b1;

if(grantbusaccess) begin
addressbus<=memoryaddressreg;  // write to the output address bus, fetch for address programcounter

if(ready) begin
    mar_next_state[7:0] <= databus;  // memory address register for the next state is equal to the value of the databus, jump to this memory location
   mar_next_state[11:8]<=instr_register[3:0];
  state_machine_next_state<=`executefullinstruction;
   pc_next_state<=programcounter+1;
end // ready signal
else
state_machine_next_state<=`fetchOpcode; // wait for ready signal

end // grantbus access signal
else
state_machine_next_state<=`fetchOpcode;  // wait for grantbusaccess signal

end

`executefullinstruction : begin

case (instr_register[7:5])


`sta:begin
write_mem <= 1'b1;

if(grantbusaccess) begin
addressbus<=memoryaddressreg;  // write to the output address bus, fetch for address programcounter
databusoutput <= accummulator;

if(ready) 
state_machine_next_state<=`initialize;
else
state_machine_next_state<=`executefullinstruction; // wait for ready signal

end
else
state_machine_next_state<=`executefullinstruction; // wait for grantbusaccess signal

end

`lda: begin
read_mem <=1'b1;

if(grantbusaccess) begin
addressbus<=memoryaddressreg;  // write to the output address bus, fetch for address programcounter

   if(ready) begin
	tempResultRegister = {statusregister [3:2], databus};

	sr_next_state<={tempResultRegister[9],tempResultRegister[8],~| tempResultRegister[7:0],tempResultRegister[7] };
	acc_next_state<=tempResultRegister[7:0];
	state_machine_next_state<=`initialize;
	end
    else
	state_machine_next_state<=`executefullinstruction; // wait for ready signal
end
else
     state_machine_next_state<=`executefullinstruction; // wait for grantbusaccess signal

end


`ann: begin
read_mem <=1'b1;

if(grantbusaccess) begin
addressbus<=memoryaddressreg;  // write to the output address bus, fetch for address programcounter

if(ready) begin
	tempResultRegister = {statusregister [3:2], (accummulator&databus)};

	sr_next_state<={tempResultRegister[9],tempResultRegister[8],~| tempResultRegister[7:0],tempResultRegister[7] };
	acc_next_state<=tempResultRegister[7:0];
	state_machine_next_state<=`initialize;
end
   else // wait for ready signal
	state_machine_next_state<=`executefullinstruction; // wait for ready signal
end
  else  // end of grantbus access
     state_machine_next_state<=`executefullinstruction; // wait for grantbusaccess signal

end  // end of and operation

`add:begin
read_mem <=1'b1;
if(grantbusaccess) begin
addressbus<=memoryaddressreg;  // write to the output address bus, fetch for address programcounter

if(ready) begin
tempResultRegister = {accummulator+databus+statusregister[2]};

	if (accummulator[7] == databus[7] && tempResultRegister[7] != accummulator[7])
	tempResultRegister[9]=1'b1;
	else tempResultRegister[9]=1'b0;

		sr_next_state<={tempResultRegister[9],tempResultRegister[8],~| tempResultRegister[7:0],tempResultRegister[7] };
		acc_next_state<=tempResultRegister[7:0];
		state_machine_next_state<=`initialize;
	end  // end of ready signal
    else
	state_machine_next_state<=`executefullinstruction; // wait for ready signal
end // end of grant bus access
else
     state_machine_next_state<=`executefullinstruction; // wait for grantbusaccess signal
end  // end of add operation


`sbb:begin
read_mem <=1'b1;
if(grantbusaccess) begin
addressbus<=memoryaddressreg;  // write to the output address bus, fetch for address programcounter

if(ready) begin
tempResultRegister = {accummulator-databus-statusregister[2]};

if (accummulator[7] == ~databus[7] && tempResultRegister[7] != accummulator[7])
tempResultRegister[9]=1'b1;
else tempResultRegister[9]=1'b0;

sr_next_state<={tempResultRegister[9],tempResultRegister[8],~| tempResultRegister[7:0],tempResultRegister[7] };
acc_next_state<=tempResultRegister[7:0];
state_machine_next_state<=`initialize;
end  // end of ready signal
    else
	state_machine_next_state<=`executefullinstruction; // wait for ready signal
end // end of grantbusaccesssignal
   else
     state_machine_next_state<=`executefullinstruction; // wait for grantbusaccess signal

end  // end of subtract operation



default: state_machine_next_state <= `initialize;
endcase  // end of case statement

end   // end of two byte instruction


endcase // state_machine_present_state

end // end always module

endmodule  // end of module
